import React, {component} from 'react';
import mainlogo from './logo.png';

function Templates() {
    const mainlogo = "./logo.png"
    return(
        <div>
            <div id="nav">
                <a href=""><img src={require('./logo.png')} alt="logo" /></a>
                <ul>
                <li><a href="" className="nav1">WORKSPACE</a></li>
                <li><a href="" className="nav1">TEMPLATE</a></li>
                <li><a href="" className="nav1">GUIDE</a></li>
                <li><a href="" className="nav1">MYPAGE</a></li>
                <li><a href="" className="logoutB">logout</a></li>
                </ul>
            </div>
            <div id="Temp">hello</div>
        </div>
    )
}

export default Templates;
